import React from 'react';

export const PageLeft = (props) => {
  return (
    <div style={styles.backgroundStyle}>
      {props.children}
    </div>
  );
};

const styles = {
  backgroundStyle: {
    background: 'purple',
    position: 'relative',
    height: '100%',
    width: '70%',
    border: '2px solid grey',
  },
};
